import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import { dbService } from "fbase";

const Carinfo = () => {
  const location = useLocation()
  const ID = location.pathname.substring(9)
  const [carlist, setCarlist] = useState([]);
  useEffect(() => {
    dbService.collection("Car").onSnapshot((snapshot) => {
      const carlistArray = snapshot.docs.map((doc) => ({
        id: doc.id,
        ...doc.data(),
      }));
      setCarlist(carlistArray);
    });
  }, []);
  console.log(carlist.map)
  return (
    <div class="container">
      <div class="header">
        <ul class="nav">
          <li class="car_information">109다 8728 / 현대AVANTE</li>
          <li class="YES">접수</li>
          <li class="NO">보류</li>
        </ul>
      </div>
      <div class="camera">
        <div class="layer">
          <h1>실시간 영상</h1>
          <div class="camera_a">
            <ul class="box">
              <li>
              <iframe src="https://eei.jbnu.ac.kr/eei/index.do" width="320px" height="240px" name="iframe_1" title="camera"></iframe>
              </li>
              <li>
              <iframe src="https://eei.jbnu.ac.kr/eei/index.do" width="320px" height="240px" name="iframe_2" title="camera"></iframe>
            </li>
            </ul>
          </div>
          <div class="camera_b">
            <iframe src="https://eei.jbnu.ac.kr/eei/index.do" width="720px" height="300px" name="iframe_3" title="camera"></iframe>
          </div>
        </div>
      </div>
      <div class="car">
        <h2>차량 파손 부위</h2>
        <div class="broken">
            <div class="part1"></div>
            <div class="part2"></div>
            <div class="part3"></div>
            <div class="part4"></div>
            <div class="part5"></div>
            <div class="part6"></div>
          </div>
      </div>
      <div class="map_weather">
        <ul class="mp_list">
          <li class="map_link">
            <iframe src="https://eei.jbnu.ac.kr/eei/index.do" width="400px" height="240px" name="iframe_4" title="map"></iframe>
          <h3>사고 위치는 "서울 송파구 올림픽로 25입니다"</h3>
          </li>
          <li class="weather_link">
            <iframe src="https://eei.jbnu.ac.kr/eei/index.do" width="400px" height="240px" name="iframe_5" title="weather"></iframe>
          <h3>사고 지점의 날씨 정보를 확인할 수 있습니다.</h3>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Carinfo;
